import { ProductType } from "../types"


type IProps = {
    product: ProductType
}

const Product = (props: IProps) => {
    const { product } = props  

    if (!product.isAvailable) return null

    return (
        <>
            <div className="bg-pri p-mid rounded-lg">
                <div>
                    <h4>{product.name}</h4>
                    <h4>{product.price}$</h4>
                </div>
                <p>{product.description}</p>
            </div>
        </>
    )

}
export default Product
